import React from 'react';

class Curriculum extends React.Component {
  render(){
    return (
      <form>
        <fieldset>
          <label htmlFor="">Resume Summary</label>
          <textarea />
          <label htmlFor="">Job Role</label>
          <textarea />
          <label htmlFor="">Job Description</label>
          <input type="text"/>
        </fieldset>
      </form>
    )
  }
}
